completeVocabularyData.forEach(word => {
    word.totalDistance = 0.4 * word.meaningDistance +
                        0.3 * word.visualDistance +
                        0.3 * word.pronunciationDistance;
    word.totalDistance = Math.round(word.totalDistance * 100) / 100;

    if (word.totalDistance < 0.4) {
        word.difficulty = 'easy';
        word.difficultyLabel = 'Easy';
    } else if (word.totalDistance < 0.7) {
        word.difficulty = 'medium';
        word.difficultyLabel = 'Medium';
    } else {
        word.difficulty = 'hard';
        word.difficultyLabel = 'Hard';
    }
});

